import { STORE_DATA } from "../ActionTypes/actiontype";
const init = {
  data: [],
};
const productreducer = (state = init, action) => {
  switch (action.type) {
    case STORE_DATA:
      return { ...state, data: action.payload };
    default:
      return state;
  }
};
export { productreducer };
